import HaveInvolved from "./pages/haveInvolved";
import NoSurvey from "./pages/noSurvey";

export function render(errCode) {
	switch (errCode) {
		case 1:
		case 2: {
			return <NoSurvey/>;
		}
		case 3: {
			return <HaveInvolved/>;
		}
		default: {

		}
	}
}
